import React from 'react';
import { Switch, Route } from 'react-router-dom';

import SignIn from '../pages/SignIn';

import Deliverys from '../pages/Deliverys';
import DeliveryMan from '../pages/DeliveryMan';
import Recipient from '../pages/Recipient';
import Problems from '../pages/Problems';

// set routes of our application
export default function Routes() {
  return (
    <Switch>
      <Route path="/" exact component={SignIn} />

      <Route path="/entregas" component={Deliverys} />
      <Route path="/entregadores" component={DeliveryMan} />
      <Route path="/destinatÃ¡rios" component={Recipient} />
      <Route path="/problemas" component={Problems} />
    </Switch>
  );
}
